import React from "react";
import { HeaderStyle } from './styles'

function Header() {
    return (
        <HeaderStyle>
            <div className="header">
                <h1><span>Soccer</span>Manager</h1>

                <div className="menu">

                <p>Home</p>
                <p>Login</p>
                <div className="btnCadastrar">Cadastrar-se</div>

                </div>

            </div>
        </HeaderStyle>
    );
}

export default Header;
